(80,	'{\"version_info\":{\"id\":\"80\",\"release\":1621375200,\"name\":\"osu!2021 input fix\",\"version\":\"b20210520.2\"},\"archive_info\":{\"archiver\":\"Bubbleman\",\"archiver_url\":null,\"archiver_id\":\"5182050\",\"description\":\"This version used to be the last one before a lot of players started feeling icy movement after an update, <a href=\\\"https:\\/\\/twitter.com\\/Bubbleman532\\/status\\/1426294515497906179\\\">and the one to stir up lots of drama on Twitter regarding everyone switching back to this version.<\\/a>\",\"description_short\":\"0\",\"auto_update\":false,\"requires_supporter\":false,\"allows_comments\":true,\"group\":1,\"approved\":true,\"video\":\"\",\"extra_info\":\"Some users had reported feeling slightly icy movement in newer versions. Rolling back seemed to fix this issue.\"},\"stats\":{\"views\":\"14266\",\"downloads\":\"5582\"},\"downloads\":{\"main\":{\"name\":\"Osekai Servers\",\"link\":\"b20210520.2.zip\"}},\"screenshots\":[\"b20210520.2_1.png\"]}',	14478,	5612,	'2021-05-19 00:00:00',	NULL),
